webpackJsonp([28240868352697],{1496:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/webcam-face-detection-spooky-goings-on/index.md absPath of file >>> MarkdownRemark",html:'<h3>... at MMT Digital.</h3>\n<a href="http://www.mmtdigital.co.uk/RVEc4d1cd790afe4ac4be58071a72c98148,,.aspx" target="_blank"><img class="alignnone size-full wp-image-978" title="Augmented Reality Halloween" src="/content/images/2009/10/halloween.jpg" alt="Augmented Reality Halloween" width="500" height="280" /></a>\n<p>Here\'s a bit of Friday afternoon fun for you.  I was playing around with some Actionscript face detection libraries last night, combined them with a webcam, some dynamic overlays, and voila! Augmented Reality, and just in time for Halloween too.  You will need a webcam to <a href="http://www.mmtdigital.co.uk/RVEc4d1cd790afe4ac4be58071a72c98148,,.aspx" target="_blank">try it out</a> yourself, as it\'s just an early prototype, but we thought it was cool enough to stick on the company homepage for a short while.</p>\n<p><strong>Update: </strong>You can see a live version and download the source code, from <a href="http://www.psyked.co.uk/adobe/flash/webcam-face-detection-demo-now-with-source.htm" target="_self">this post</a>.</p>',frontmatter:{title:"Webcam + face detection = Spooky goings on...",date:"October 23, 2009",tags:["flash","augmented-reality","halloween"]}}},pathContext:{}}}});
